f = thisComp.layer('text6').sourceRectAtTime() ? thisComp.layer('text6').sourceRectAtTime().width : 0;
x = Math.max(a, b, c, d, e, f);
t = effect('Slider Control')('Slider');
w = 300;
hs = $bm_div(600, t);
ws = $bm_mul($bm_div(w, x), 100);
resize = Math.min(hs, ws);
$bm_rt = [
    resize,
    resize
];

